  false,\n\t\"url\": null,\n\t\"notes\": \"When a species is proposed for listing
  as endangered or threatened under the Endangered Species Act, the U.S. Fish and
  Wildlife Service must consider whether there are areas of habitat believed to be
  essential the speciesu00e2u0080u0099 conservation. Those areas may be proposed for
  designation as u00e2u0080u009ccritical habitatu00e2u0080u009d. Critical habitat
  is a term defined and used in the Act. It is a specific geographic area(s) that
  contains features essential for the conservation of a threatened or endangered species
  and that may require special management and protection. Critical habitat may include
  an area that is not currently occupied by the species but that will be needed for
  its recovery. An area is designated as u00e2u0080u009ccritical habitatu00e2u0080u009d
  after the Service publishes a proposed Federal regulation in the Federal Register
  and receives and considers public comments on the proposal. The final boundaries
  of the critical habitat are also published in the Federal Register.\",\n\t\"license_title\":
